import React, { Component } from 'react'
import {bindActionCreators} from 'redux'
import {connect} from 'react-redux'
import * as categoryActions from '../redux/actions/categoriesAction'

class AboutUnsplashComponent extends Component {
    componentDidMount(){
     this.props.actions.displayImages()
    }
    render() {
        return (
            <div>
               <h1 > {this.props.images.length}</h1>
            </div>
        )
    }
}

function mapDispatchToProps(dispatch){
    return{
        actions:{getImage:bindActionCreators(categoryActions.displayImages, dispatch)}
    }

}
export default  connect(mapDispatchToProps)(AboutUnsplashComponent)
